INSERT INTO `iec_setting` VALUES (1,'启动页','init_page','uploads/20181015/NAHLjpjIZ5zrEQDy.png','iec'),(2,'钱包协议','protocol_wallet','<p><strong><strong>@YOU区块钱包使用协议</strong></strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h3><strong><strong><strong>首部和导言</strong></strong></strong></h3>\r\n\r\n<p>尊敬的用户您好，感谢您选择@YOU区块钱包服务！</p>\r\n\r\n<p>在同意@YOU区块钱包使用协议（以下统称&ldquo;本协议&rdquo;）前，请您认真阅读并充分知悉、理解@YOU的各项规则及要求，以及关于该类互联网信息服务的法律法规等。如果您对本协议的任何条款表示异议，您可以选择不使用@YOU区块钱包；使用则意味着您将同意遵守本协议下全部规定，以及我们后续对使用协议随时所作的任何修改，并完全服从于我们的统一管理。<strong><strong>本协议已对与您的权益有或可能具有重大关系的条款，及对</strong></strong><strong><strong>@YOU</strong></strong><strong><strong>具有或可能具有免责或限制责任的条款用粗体字予以标注，</strong></strong><strong><strong>确保您充分理解本协议中各条款，并自主考虑风险。</strong></strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong><strong>1&nbsp;</strong></strong><strong><strong>总则</strong></strong></p>\r\n\r\n<p>1.1&nbsp;@YOU区块钱包是@YOU团队(以下统称&ldquo;本团队&rdquo;)基于以太坊单链系统（及将来陆续支持的其他区块链系统）开发的区块链钱包，包括其他为方便用户使用区块链系统而开发的辅助工具。支持二维码在平台内的转账支付及加密字符实现所有平台的数字资产转账，链接房地产及其产业链与区块链，您使用本软件的区块钱包表示您理解本协议及有关协议适用于@YOU所自主开发和拥有的去中心化应用。</p>\r\n\r\n<p>1.2&nbsp;您下载@YOU软件并创建或导入区块钱包，即视为您已经充分阅读并接受本协议全部条款，本协议立即生效，对双方具有约束力。</p>\r\n\r\n<p>1.3&nbsp;@YOU的所有权、经营权、管理权和最终解释权均归属于@YOU。本协议可随时更新，经修改的协议一经在@YOU上公布，立即生效，恕不再另行通知。在@YOU平台上公布修改协议条款后，如果您不接受修改后的条款，请立即停止使用@YOU，您继续使用@YOU将被视为接受修改后的协议。</p>\r\n\r\n<p>1.4&nbsp;本协议与其他协议具有同等法律效力，如有相驳之处以主协议（@YOU隐私政策和@YOU软件许可及服务协议）为主。</p>\r\n\r\n<p>1.5&nbsp;区块钱包用户必须是具备完全民事行为能力的自然人；若您为18周岁以下的未成年人使用区块钱包服务，需要在您父母或监护人的指导下使用区块钱包。无民事行为能力人使用区块钱包或限制民事行为能力人超过其民事权利能力或民事行为能力范围发生交易行为所造成的一切后果，@YOU有权要求您及您的父母或监护人负责。</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong><strong>2&nbsp;</strong></strong><strong><strong>区块钱包</strong></strong></p>\r\n\r\n<p>2.1&nbsp;<strong><strong>区块钱包</strong></strong>：是本团队基于以太坊单链系统（及将来陆续支持的其他区块链系统）开发的区块链钱包，包括其他为方便用户使用区块链系统而开发的辅助工具。（以下统称为&ldquo;钱包&rdquo;）</p>\r\n\r\n<p>2.2&nbsp;<strong><strong>令牌</strong></strong>：指@YOU目前支持的数字资产种类，包括但不限于BTC、ETH、IEC等。</p>\r\n\r\n<p>2.3&nbsp;<strong><strong>转入</strong></strong>：是指您在使用钱包时，对@YOU支持的令牌使用，您可以通过输入区块地址或<strong><strong>扫描二维码（站外二维码）</strong></strong>转入相关区块链系统的其他钱包工具的数字资产。</p>\r\n\r\n<p>2.4&nbsp;<strong><strong>转出</strong></strong>：是指您在使用钱包时，对@YOU支持的令牌使用，您可以通过输入其他相关区块链系统的钱包地址将@YOU令牌从钱包中转出。</p>\r\n\r\n<p>2.5&nbsp;<strong><strong>@YOU收款和@YOU付款</strong></strong>：是指您使用钱包时，通过<strong><strong>扫描二维码（站内二维码）</strong></strong>对@YOU平台内的令牌使用。</p>\r\n\r\n<p>2.6&nbsp;<strong><strong>钱包二维码和钱包地址：</strong></strong>为方便用户使用钱包，钱包站内和站外二维码区分开并分别使用，钱包地址支持所有相关区块链系统的钱包工具收付转账。</p>\r\n\r\n<p>2.7&nbsp;<strong><strong>站外转账</strong></strong>包括转入和转出，分别是指付款方利用转入方的区块链地址进行转账操作，转出方利用收款方的区块链地址进行转账操作，实际的转账行为均在相关区块链系统发生，您使用钱包进行区块系统间的转入、转出功能进行数字资产的管理，即是对相关区块链的账本进行修改。</p>\r\n\r\n<p>2.8&nbsp;<strong><strong>站内转账</strong></strong>包括@YOU收款和@YOU付款，转账行为在平台内发生。</p>\r\n\r\n<p>2.9 您可以使用钱包转入、保存及转出其所支持的数字资产。@YOU的钱包令牌余额可由您在@YOU平台上自由使用，例如：红包、转账、理财、闪兑、商城购物、公寓酒店民宿预订等地使用，所有的使用需遵循平台规则并合规使用。</p>\r\n\r\n<p>2.10 钱包作为@YOU平台的令牌通证管理工具，并非交易所。平台内转账支付不收取任何费用，平台外的转账行为在相关区块系统发生，但随着平台承担的责任不断增加，不排除未来会为平台的运维成本收取手续费，相关收费规则会在平台公布，恕不再另行通知。如果您不接受修改后的条款，请立即停止使用@YOU，您继续使用@YOU将被视为接受修改后的协议。</p>\r\n\r\n<p><strong><strong>2.11 请您知悉基于区块链系统交易的&ldquo;不可撤销&rdquo;的属性，我们不能为您暂停或撤销转入、转出等操作，但在一定情况下，我们可以暂停或限制某位用户对@YOU软件钱包的使用。</strong></strong></p>\r\n\r\n<p><strong><strong>2.12 用户应自行妥善保管移动设备、钱包密码等信息。@YOU不负责为用户保管任何信息。因为您遗失移动设备、主动或被动泄露、遗忘钱包密码，或遭受他人攻击、诈骗等所引起的一切风险、责任、损失和费用应由您自行承担。</strong></strong></p>\r\n\r\n<p><strong><strong>2.13&nbsp;</strong></strong><strong><strong>@YOU</strong></strong><strong><strong>区块钱包是数字资产的管理工具，它不是确切的某一具体通证。</strong></strong><strong><strong>在使用时，若因您自身选择</strong></strong><strong><strong>转账</strong></strong><strong><strong>的</strong></strong><strong><strong>令牌</strong></strong><strong><strong>错误、操作不当而产生的多次手续费扣除</strong></strong><strong><strong>或因转账错误导致的资产和权益损失</strong></strong><strong><strong>（</strong></strong><strong><strong>转账包括转入和转出，</strong></strong><strong><strong>是指</strong></strong><strong><strong>转入</strong></strong><strong><strong>方</strong></strong><strong><strong>和转出方</strong></strong><strong><strong>利用</strong></strong><strong><strong>@YOU</strong></strong><strong><strong>钱包</strong></strong><strong><strong>地址</strong></strong><strong><strong>或钱包二维码</strong></strong><strong><strong>进行转账操作，实际的</strong></strong><strong><strong>转入</strong></strong><strong><strong>行为在相关区块链系统发生，因而产生的手续费均由区块链系统扣取，而非在</strong></strong><strong><strong>@YOU</strong></strong><strong><strong>中扣取）</strong></strong><strong><strong>，@YOU</strong></strong><strong><strong>将不会作出任何补偿或赔偿。</strong></strong></p>\r\n\r\n<p><strong><strong>2.14&nbsp;</strong></strong><strong><strong>若您以非</strong></strong><strong><strong>合规</strong></strong><strong><strong>的方式，或使用非</strong></strong><strong><strong>@YOU</strong></strong><strong><strong>所提供的</strong></strong><strong><strong>转入</strong></strong><strong><strong>方式进行</strong></strong><strong><strong>转入</strong></strong><strong><strong>，</strong></strong><strong><strong>@YOU</strong></strong><strong><strong>不保证该</strong></strong><strong><strong>转入</strong></strong><strong><strong>顺利或正确完成。若因此造成您权益</strong></strong><strong><strong>与</strong></strong><strong><strong>资产的</strong></strong><strong><strong>受损，</strong></strong><strong><strong>@YOU</strong></strong><strong><strong>不会作出任何补偿或赔偿，</strong></strong><strong><strong>@YOU</strong></strong><strong><strong>同时保留随时终止您使用</strong></strong><strong><strong>@YOU</strong></strong><strong><strong>账号资格及使用各项</strong></strong><strong><strong>转</strong></strong><strong><strong>账</strong></strong><strong><strong>服务的权利。</strong></strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong><strong>3 风险提示</strong></strong></p>\r\n\r\n<p><strong><strong>3.1</strong></strong><strong><strong>进行</strong></strong><strong><strong>转入</strong></strong><strong><strong>时，您应确保您是该</strong></strong><strong><strong>@YOU</strong></strong><strong><strong>账号的持有人，可合法、有效使用该账户且未侵犯任何用户合法权益</strong></strong><strong><strong>，</strong></strong><strong><strong>否则因此造成</strong></strong><strong><strong>@YOU区块钱包</strong></strong><strong><strong>内实际所有人损失的，您应单独负责解决由此产生的纠纷并承担全部法律责任。</strong></strong><strong><strong>进行转出时，您应知悉平台的转出规则（含费用的调整），确保转出地址为有效正确的地址，有任何规则的变化都会在相应服务页面进行通知或公告。</strong></strong></p>\r\n\r\n<p><strong><strong>3.2&nbsp;</strong></strong><strong><strong>因您自身的原因导致</strong></strong><strong><strong>@YOU</strong></strong><strong><strong>无法提供</strong></strong><strong><strong>区块钱包</strong></strong><strong><strong>服务产生的任何损失或责任，由您自行负责，</strong></strong><strong><strong>@YOU</strong></strong><strong><strong>不承担责任，包括但不限于：</strong></strong></p>\r\n\r\n<p><strong><strong>1）</strong></strong><strong><strong>您未按照本协议或</strong></strong><strong><strong>@YOU</strong></strong><strong><strong>不时公布的任何规则进行操作；</strong></strong></p>\r\n\r\n<p><strong><strong>2）</strong></strong><strong><strong>因您的</strong></strong><strong><strong>个</strong></strong><strong><strong>人账号失效、丢失、被封停；</strong></strong></p>\r\n\r\n<p><strong><strong>3）</strong></strong><strong><strong>您将密码告知他人导致的财产损失；</strong></strong></p>\r\n\r\n<p><strong><strong>4）</strong></strong><strong><strong>因您个人的故意或重大过失</strong></strong><strong><strong>的转账错误及其他非常行为</strong></strong><strong><strong>所造成的财产损失。</strong></strong></p>\r\n\r\n<p><strong><strong>3.3 若</strong></strong><strong><strong>@YOU</strong></strong><strong><strong>因下列</strong></strong><strong><strong>非@YOU可掌控的</strong></strong><strong><strong>状况</strong></strong><strong><strong>而</strong></strong><strong><strong>无法正常运作，使您无法使用各项服务或</strong></strong><strong><strong>区块钱包</strong></strong><strong><strong>余额财产丢失时，本团队不承担损害赔偿责任</strong></strong><strong><strong>。</strong></strong><strong><strong>但经判断，若在本团队权限和能力范围内的资产损失，本团队必当竭力帮助用户追索资产线索并减少用户损失。</strong></strong><strong><strong>该状况包括但不限于：</strong></strong></p>\r\n\r\n<p><strong><strong>1）</strong></strong><strong><strong>在</strong></strong><strong><strong>@YOU</strong></strong><strong><strong>公告系统停机维护、升级、调整期间；</strong></strong></p>\r\n\r\n<p><strong><strong>2）</strong></strong><strong><strong>电信通讯或设备出现故障不能进行数据传输的；</strong></strong></p>\r\n\r\n<p><strong><strong>3）</strong></strong><strong><strong>因台风、地震、海啸、洪水、停电、战争、恐怖袭击、政府管制等不可抗力之因素，造成</strong></strong><strong><strong>@YOU</strong></strong><strong><strong>系统障碍不能执行业务的；</strong></strong></p>\r\n\r\n<p><strong><strong>4）</strong></strong><strong><strong>由于黑客攻击、电信部门技术调整或故障、网站升级、相关第三方的问题等原因而造成的服务中断或者延迟。</strong></strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong><strong>4 附则</strong></strong></p>\r\n\r\n<p><strong><strong>4.1 您了解并知悉，由于数字资产领域的法律法规政策尚未健全，该领域的数字资产可能会产生无法兑现、技术不稳定等重大风险。且数字资产的价格波动幅度远高于其他金融资产。我们谨慎提醒您应当根据自身财务状况和风险偏好，理性选择持有或处置任何一种数字资产。@YOU提供的行情查看功能仅系抓取部分交易所的数字资产汇率信息的搜索结果，并不表示为最新行情或最佳报价。</strong></strong></p>\r\n\r\n<p><strong><strong>4.2 在使用钱包服务时，若您或您的相对方未遵从本协议或相关网站说明、交易、支付页面中之操作提示、规则，@YOU并不保证交易会顺利完成，且@YOU不承担损害赔偿责任。若发生前述情形，而款项已先行入账您的或您的交易方的@YOU钱包或第三方钱包，您理解区块链操作具有的&ldquo;不可逆&rdquo;属性，以及相关交易具有&ldquo;不可撤销&rdquo;的特征，由您及您的相对方自行承担相应的风险后果。</strong></strong></p>\r\n\r\n<p><strong><strong>4.3 &nbsp;在您使用@YOU及与平台合作的第三方服务时，为了您的利益，@YOU建议您仔细阅读本协议及操作步骤提示，了解交易对象及产品信息，谨慎评估风险后再采取行动。所有您在第三方进行的交易行为系您的个人行为，有约束力的合同关系在您和您的相对方之间建立，与@YOU无关。@YOU对因您的交易行为所引起的一切风险、责任、损失、费用不承担任何责任。</strong></strong></p>\r\n\r\n<p>4.4 我们建议您在安全的网络环境中使用@YOU，并确保您的移动设备没有越狱或Root或其他可能扩大风险的情况， 以避免可能存在的安全隐患.</p>\r\n\r\n<p>4.5 本协议保留@YOU修改或增补本协议内容的权利。其修订版之效力、解释、变更、执行与争议解决均适用相关法律，如无相关法律规定，则应当适用国际商业惯例和（或）行业惯例。本协议用户均需了解并遵守相关法律、法规及规则。</p>\r\n\r\n<p>4.6 若您和@YOU之间发生任何纠纷或争议，首先应友好协商解决，协商不成的，任何一方可提交@YOU所在地有管辖权的法院管辖。</p>\r\n\r\n<p>4.7&nbsp;<strong><strong>您在使用@YOU服务过程中，如遇到任何问题，您可以通过可与@YOU客服部门联系（</strong></strong><a href=\"mailto:liannigroup@sina.com\"><strong><strong>liannigroup@sina.com</strong></strong></a><strong><strong>），我们会给予您必要的帮助。</strong></strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong><strong>本协议未尽事宜，您需遵守@YOU不时更新的公告及相关规则。</strong></strong></p>\r\n\r\n<p><strong><strong>(以下无正文)</strong></strong></p>\r\n\r\n<p>&nbsp;</p>\r\n','iec'),(3,'服务协议','protocol_license','<p>&nbsp;</p>\r\n\r\n<p><strong><strong>@YOU软件许可及服务协议</strong></strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h3><strong><strong><strong>首部和导言</strong></strong></strong></h3>\r\n\r\n<p>欢迎您使⽤@YOU软件及服务！</p>\r\n\r\n<p>为使⽤@YOU软件（以下简称&ldquo;本软件&rdquo;）及服务，您应当阅读并遵守《@YOU软件许可及服务协议》（以下简称&ldquo;本协议&rdquo;）。请您务必审慎阅读、充分理解各条款内容，特别是免除或者限制责任的条款、管辖与法律适用条款，以及开通或使⽤某项服务的单独协议，并选择接受或不接受。限制、免责条款可能以加粗形式提示您注意。除⾮您已阅读并接受本协议所有条款，否则您⽆权下载、安装或使⽤本软件及相关服务。您的下载、安装、使⽤、获取@YOU帐号、登录等⾏为即视为您已阅读并同意上述协议的约束。</p>\r\n\r\n<p><strong><em><strong><em>您承诺遵守以下约定：在使用</em></strong></em></strong><strong><em><strong><em>@YOU</em></strong></em></strong><strong><em><strong><em>平台服务过程中实施的所有行为均遵守您所在国家法律、法规等规范性文件及</em></strong></em></strong><strong><em><strong><em>@YOU</em></strong></em></strong><strong><em><strong><em>平台各项规则的规定和要求，不违背社会公共利益或公共道德，不损害他人的合法权益，不偷逃应缴税费，不违反本协议及相关规则。您如果违反前述承诺，产生任何法律后果的，您应以自己的名义独立承担所有的法律责任，并确保</em></strong></em></strong><strong><em><strong><em>@YOU</em></strong></em></strong><strong><em><strong><em>平台免于因此产生任何损失；</em></strong></em></strong><strong><em><strong><em>@YOU</em></strong></em></strong><strong><em><strong><em>平台有权对您违反前述承诺的行为采取包括但不限于警示、限制功能、关闭账号等处置措施。</em></strong></em></strong></p>\r\n\r\n<p>如果您未满18周岁，请在法定监护⼈的陪同下阅读本协议及其他上述协议，并特别注意未成年⼈使⽤条款。</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong><strong>一．</strong></strong><strong><strong>协议的范围</strong></strong></p>\r\n\r\n<p>1.1 协议适⽤主体范围</p>\r\n\r\n<p>本协议是您与@YOU之间关于您下载、安装、使⽤、复制本软件，以及使⽤@YOU相关服务所订⽴的协议。本协议项下的服务是指@YOU向用户提供的包括但不限于即时通讯、网络媒体、互联网增值、互动娱乐、电子商务、钱包服务和广告等产品及服务（以下简称&ldquo;本服务&rdquo;）。</p>\r\n\r\n<p>1.2 协议关系及冲突条款</p>\r\n\r\n<p>本协议内容同时包括@YOU可能不断发布的关于本服务的相关协议、相关业务规则等（以下统称为&ldquo;单独协议&rdquo;）。上述内容⼀经正式发布，即为本协议不可分割的组成部分，您同样应当遵守。您对前述任何业务规则、单独协议的接受，即视为您对本协议全部的接受。</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong><strong>二．许可内容</strong></strong></p>\r\n\r\n<p>2.1 除本⽤户协议明确规定外，未经@YOU及/或其他权利⼈事先明确书⾯同意，您不得为出版或发⾏或为任何其他商业⽬的以任何⽅式将本软件的任何部分及任何内容复制、再制、重印、上传、发布、公开展示、编码、翻译、传输或散布⾄任何其他终端、⽹站或其他媒介。</p>\r\n\r\n<p>2.2 对于您⾃⼰上传的个⼈数据和同步数据，您拥有所有权，为了给您提供相应的服务，您同意授予@YOU⾮排他性、不可转让、免费的权利使⽤上述所有数据。</p>\r\n\r\n<p>2.3 本条及本协议其他条款未明示授权的其他⼀切权利仍由@YOU保留，您在⾏使这些权利时须另外取得@YOU的书⾯许可。@YOU如果未⾏使前述任何权利，并不构成对该权利的放弃。</p>\r\n\r\n<p>2.4 您使⽤本服务需要下载@YOU客户端软件，对于这些软件，@YOU给予您⼀项个⼈的、不可转让及⾮排他性的许可，您仅可为访问或使⽤本服务的⽬的⽽使⽤这些软件及服务；本服务中@YOU客户端软件可能提供包括但不限于iOS、 Android等多个应⽤版本，⽤户必须选择与所安装终端设备相匹配的软件版本；您可以为使⽤本软件及服务的⽬的复制本软件的⼀个副本，仅⽤作备份。备份副本必须包含原软件中含有的所有著作权信息。</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong><strong>三．软件的获取</strong></strong></p>\r\n\r\n<p>3.1 您可以直接从@YOU的⽹站上获取本软件，也可以从得到@YOU授权的第三⽅获取。</p>\r\n\r\n<p>3.2 如果您从未经@YOU授权的第三⽅获取本软件或与本软件名称相同的安装程序，@YOU⽆法保证该软件能够正常使⽤，并对因此给您造成的损失不予负责。</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong><strong>四．软件的安装、更新与卸载</strong></strong></p>\r\n\r\n<p>4.1 @YOU可能为不同的终端设备开发了不同的软件版本，您应当根据实际情况选择下载合适的版本进⾏安装。</p>\r\n\r\n<p>4.2 下载安装程序后，您需要按照该程序提示的步骤正确安装。</p>\r\n\r\n<p>4.3 为提供更加优质、安全的服务，在本软件安装时@YOU可能推荐您安装其他软件，您可以选择安装或不安装。</p>\r\n\r\n<p>4.4 如果您不再需要使⽤本软件或者需要安装新版软件，可以⾃⾏卸载。如果您愿意帮助@YOU改进产品服务，请告知卸载的原因。</p>\r\n\r\n<p>4.5 为了改善⽤户体验、完善服务内容，@YOU将不断努⼒开发新的服务，并为您不时提供软件更新（这些更新可能会采取软件替换、修改、功能强化、版本升级等形式）。</p>\r\n\r\n<p>4.6 为了保证本软件及服务的安全性和功能的⼀致性，@YOU有权不经向您特别通知⽽对软件进⾏更新，或者对软件的部分功能效果进⾏改变或限制。</p>\r\n\r\n<p>4.7 本软件新版本发布后，旧版本的软件可能⽆法使⽤。@YOU不保证旧版本软件继续可⽤及相应的客户服务，请您随时核对并下载最新版本。</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong><strong>五．账户管理</strong></strong></p>\r\n\r\n<p>5.1 ⽤户注册成为本软件⽤户即可获得⼀个@YOU帐号（以下或称&ldquo;帐户&rdquo;），本软件提供的某些功能或服务可能要求您开⽴帐户。对于维护您持有帐户信息的保密性，包括您的密码，您需要妥善的进⾏保管。您同意⼀旦发⽣任何对您帐户或密码未经授权的使⽤，或者任何其他对安全的破坏情况，应当⽴即通知@YOU。</p>\r\n\r\n<p>5.2 @YOU帐号的所有权归@YOU所有，您完成申请注册⼿续后，获得帐号的使⽤权，该使⽤权仅属于初始申请注册⼈，初始申请注册⼈不得赠与、借⽤、租⽤、转让或售卖帐号或者以其他⽅式许可⾮初始申请注册⼈使⽤帐号。⾮初始申请注册⼈不得通过受赠、继承、承租、受让或者其他任何⽅式使⽤帐号。</p>\r\n\r\n<p>5.3 您在注册帐号或使⽤本服务的过程中，需要提供⼀些必要的信息，例如：为向您提供帐号注册服务或进⾏⽤户身份识别，需要您填写⼿机号码；如您使⽤邮箱帐号进⾏注册、绑定，@YOU有权根据⽤户需求或产品需要对帐号注册和绑定的⽅式进⾏变更；若国家法律法规或政策有特殊规定的，您需要提供真实的身份信息。若您提供的信息不完整，则⽆法使⽤本服务或在使⽤过程中受到限制。</p>\r\n\r\n<p>5.4 ⼀般情况下，您可随时浏览、修改⾃⼰提交的信息，但出于安全性和身份识别（如帐户申诉服务）的考虑，您可能⽆法修改注册时提供的初始注册信息及其他验证信息。</p>\r\n\r\n<p>5.5 ⽤户应遵守本协议的各项条款，正确、适当地使⽤本服务，如⽤户违反本协议中的任何条款，@YOU在通知⽤户后有权依据协议中断或终⽌对违约⽤户帐号提供服务。</p>\r\n\r\n<p>5.6 ⽤户有责任妥善保管注册帐户信息及帐户密码的安全，⽤户需要对注册帐户以及密码下的⾏为承担法律责任。⽤户同意在任何情况下不向他⼈透露帐户及密码信息。当在您怀疑他⼈在使⽤您的帐号时，您应⽴即通知@YOU。</p>\r\n\r\n<p>5.7 ⽤户注册帐号后如果⻓期不登录该帐号，@YOU有权回收该帐号，以免造成资源浪费，由此带来的任何损失均由⽤户⾃⾏承担。</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong><strong>六．用户行为规范</strong></strong></p>\r\n\r\n<p>6.1 信息内容规范</p>\r\n\r\n<p>⽤户在使⽤本软件时，必须遵守中华⼈⺠共和国相关法律法规及相关国际公约的规定，⽤户应同意将不会利⽤本服务进⾏任何违法或不正当的活动，包括但不限于下列⾏为:</p>\r\n\r\n<p>6.1.1 ⽤户不得上载、展示、张贴、传播或以其它⽅式传送含有下列内容之⼀的信息：</p>\r\n\r\n<p>(1) 违反中华⼈⺠共和国宪法确定的基本原则的；</p>\r\n\r\n<p>(2) 危害国家安全，泄露国家秘密，颠覆国家政权，破坏国家统⼀的；</p>\r\n\r\n<p>(3) 损害国家荣誉和利益的；</p>\r\n\r\n<p>(4) 煽动⺠族仇恨、⺠族歧视、破坏⺠族团结的；</p>\r\n\r\n<p>(5) 破坏国家宗教政策，宣扬邪教和封建迷信的；</p>\r\n\r\n<p>(6) 散布谣⾔，扰乱社会秩序，破坏社会稳定的；</p>\r\n\r\n<p>(7) 散布淫秽、⾊情、赌博、暴⼒、凶杀、恐怖或者教唆犯罪的；</p>\r\n\r\n<p>(8) 侮辱或者诽谤他⼈，侵害他⼈合法权益的</p>\r\n\r\n<p>(9) 含有虚假、有害、胁迫、侵害他⼈隐私、骚扰、侵害、中伤、粗俗、猥亵、或其它道德上令⼈反感的内容；</p>\r\n\r\n<p>(10) 煽动⾮法集会、结社、游⾏、示威、聚众扰乱社会秩序；</p>\r\n\r\n<p>(11) 以⾮法⺠间组织名义活动的；</p>\r\n\r\n<p>(12) 不符合应当遵守法律法规、社会主义制度、国家利益、公⺠合法利益、公众秩序、社会道德⻛尚和信息真实性等&ldquo;七条底线&rdquo;要求的；</p>\r\n\r\n<p>(13) 含有中国法律、法规、规章、条例以及任何具有法律效⼒之规范所限制或禁⽌的其它内容的；</p>\r\n\r\n<p>6.1.2 ⽤户不得利⽤帐户或本服务制作、上载、复制、发布、传播如下干扰本软件正常运营，以及侵犯其他⽤户或第三⽅合法权益的内容：</p>\r\n\r\n<p>(1) 含有任何性或性暗示的；</p>\r\n\r\n<p>(2) 含有辱骂、恐吓、威胁内容的；</p>\r\n\r\n<p>(3) 含有骚扰、垃圾⼴告、恶意信息、诱骗、过度营销信息的；</p>\r\n\r\n<p>(4) 涉及他⼈隐私、个⼈信息或资料的；</p>\r\n\r\n<p>(5) 侵害他⼈⼀般⼈格权、名誉权、肖像权、知识产权、商业秘密等合法权利的内容；</p>\r\n\r\n<p>(6) 含有其他⼲扰本软件正常运营和侵犯其他⽤户或第三⽅合法权益内容的信息。</p>\r\n\r\n<p>6.1.3⽤户不得为任何⾮法⽬的⽽使⽤软件，不利⽤本软件从事以下活动：</p>\r\n\r\n<ol>\r\n	<li>未经允许，进⼊计算机信息⽹络或者使⽤计算机信息⽹络资源的；</li>\r\n	<li>未经允许，对计算机信息⽹络功能进⾏删除、修改或者增加的；</li>\r\n	<li>未经允许，对进⼊计算机信息⽹络中存储、处理或者传输的数据和应⽤程序进⾏删除、修改或者增加的；</li>\r\n	<li>故意制作、传播计算机病毒等破坏性程序的；</li>\r\n	<li>其他危害计算机信息⽹络安全的⾏为。</li>\r\n</ol>\r\n\r\n<p>6.1.4 除非法律允许或@YOU书面许可，⽤户不得利⽤本软件从事进⾏如下⾏为：</p>\r\n\r\n<p>(1) 提交、发布虚假信息，或盗⽤他⼈头像或资料，冒充、利⽤他⼈名义；</p>\r\n\r\n<p>(2) 强制、诱导其他⽤户关注、点击链接⻚⾯或分享信息；</p>\r\n\r\n<p>(3) 虚构事实、隐瞒真相以误导、欺骗他⼈的；</p>\r\n\r\n<p>(4) 利⽤技术⼿段批量建⽴虚假账号，使用@YOU平台外挂和/或利用@YOU平台当中的BUG来获得不正当的利益；</p>\r\n\r\n<p>(5)删除或修改@YOU平台上的版权信息；</p>\r\n\r\n<p>(6)进行编译、反编译、反向工程或其他方式破解@YOU平台的行为；</p>\r\n\r\n<p>(7)制作、发布与以上⾏为相关的⽅法、⼯具，或对此类⽅法、⼯具进⾏运营或传播，⽆论这些⾏为是否为商业⽬的；</p>\r\n\r\n<p>(8) 其他违反法律法规、政策及公序良俗、社会公德或干扰@YOU正常运营和侵犯其他⽤户或第三⽅合法权益内容的信息。</p>\r\n\r\n<p>6.1.5 ⽤户违反本协议或相关的服务条款的规定，导致或产⽣的任何第三⽅主张的任何索赔、要求或损失，包括合理的律师费，您同意赔偿@YOU与合作公司、关联公司上述费⽤，并使之免受损害。对此，@YOU有权视⽤户的⾏为性质，采取包括但