trong><strong>将按照⾏业标准合理审慎地采取必要技术措施保护</strong></strong><strong><strong>您</strong></strong><strong><strong>的终端设备信息和数据安全，但是</strong></strong><strong><strong>您</strong></strong><strong><strong>承认和同意</strong></strong><strong><strong>@YOU</strong></strong><strong><strong>并不能就此提供完全保证。</strong></strong></p>\r\n\r\n<p><strong><strong>10.4 在任何情况下，</strong></strong><strong><strong>您</strong></strong><strong><strong>不应轻信索要密码或其他涉及帐户安全或财产的⽹络信息。涉及财产操作的，请⼀定先核实对⽅身份，并请经常留意</strong></strong><strong><strong>@YOU</strong></strong><strong><strong>有关防范诈骗犯罪的提示。</strong></strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong><strong>十一．广告</strong></strong></p>\r\n\r\n<p>11.1 您同意@YOU可以在提供服务的过程中自行或由第三方广告商向您发送广告、推广或宣传信息（包括商业与非商业信息），其方式和范围可不经向您特别通知而变更。</p>\r\n\r\n<p>11.2 @YOU可能为您提供选择关闭广告信息的功能，但任何时候您都不得以本协议未明确约定或@YOU未书面许可的方式屏蔽、过滤广告信息。</p>\r\n\r\n<p>11.3 @YOU依照法律的规定对广告商履行相关义务，您应当自行判断广告信息的真实性并为自己的判断行为负责，除法律明确规定外，您因依该广告信息进行的交易或前述广告商提供的内容而遭受的损失或损害，@YOU不承担责任。</p>\r\n\r\n<p>11.4 您同意：对@YOU服务中出现的广告信息，您应审慎判断其真实性和可靠性，除法律明确规定外，您应对依该广告信息进行的交易负责。</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong><strong>十二．第三方软件或技术</strong></strong></p>\r\n\r\n<p>12.1 本软件可能会使⽤第三⽅软件或技术（包括本软件可能使⽤的开源代码和公共领域代码等，下同），这种使⽤已经获得合法授权。</p>\r\n\r\n<p>12.2 本软件如果使⽤了第三⽅的软件或技术，@YOU将按照相关法规或约定，对相关的协议或其他⽂件，可能通过本协议附件、在本软件安装包特定⽂件夹中打包、或通过开源软件⻚⾯等形式进⾏展示，它们可能会以&ldquo;软件使⽤许可协议&rdquo;、 &ldquo;授权协议&rdquo;、 &ldquo;开源代码许可证&rdquo;或其他形式来表达。前述通过各种形式展现的相关协议、其他⽂件及⽹⻚，均是本协议不可分割的组成部分，与本协议具有同等的法律效⼒，您应当遵守这些要求。 如果您没有遵守这些要求，该第三⽅或者国家机关可能会对您提起诉讼、罚款或采取其他制裁措施，并要求@YOU给予协助，您应当⾃⾏承担法律责任。</p>\r\n\r\n<p>12.3 如因本软件使⽤的第三⽅软件或技术引发的任何纠纷，应由该第三⽅负责解决，@YOU不承担任何责任。@YOU不对第三⽅软件或技术提供客服⽀持，若您需要获取⽀持，请与第三⽅联系。</p>\r\n\r\n<p>12.4 您在@YOU平台上使用第三方提供的产品或服务时，除遵守本协议约定外，还应遵守第三方的用户协议。@YOU和第三方对可能出现的纠纷在法律规定和约定的范围内各自承担责任。</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong><strong>十三．收费服务</strong></strong></p>\r\n\r\n<p>13.1 @YOU的部分服务是以收费方式提供的，如您使用收费服务，请遵守相关的协议。</p>\r\n\r\n<p>13.2 @YOU可能根据实际需要对收费服务的收费标准、方式进行修改和变更，@YOU也可能会对部分免费服务开始收费。前述修改、变更或开始收费前，@YOU将在相应服务页面进行通知或公告。如果您不同意上述修改、变更或付费内容，则应停止使用该服务。</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong><strong>十四．争议解决及管辖</strong></strong></p>\r\n\r\n<p><strong><strong>1</strong></strong><strong><strong>4</strong></strong><strong><strong>.1 本⽤户协议及</strong></strong><strong><strong>您</strong></strong><strong><strong>与</strong></strong><strong><strong>@YOU</strong></strong><strong><strong>的关系</strong></strong><strong><strong>均适用相关法律，如无相关法律规定，则应当适用商业惯例和（或）行业惯例</strong></strong><strong><strong>，</strong></strong><strong><strong>但不包括其冲突法规范。</strong></strong><strong><strong>您</strong></strong><strong><strong>和</strong></strong><strong><strong>@YOU</strong></strong><strong><strong>同意服从</strong></strong><strong><strong>@YOU</strong></strong><strong><strong>所在地司法管辖。</strong></strong></p>\r\n\r\n<p><strong><strong>1</strong></strong><strong><strong>4</strong></strong><strong><strong>.2 </strong></strong><strong><strong>若</strong></strong><strong><strong>您和@YOU之间发生任何纠纷或争议，首先应友好协商解决；协商不成的，您同意将纠纷或争议提交</strong></strong><strong><strong>@YOU</strong></strong><strong><strong>所在地</strong></strong><strong><strong>有管辖权的法院管辖</strong></strong><strong><strong>。</strong></strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong><strong>十五．其他</strong></strong></p>\r\n\r\n<p><strong><strong>1</strong></strong><strong><strong>5</strong></strong><strong><strong>.1 若本协议的任何条款被享有合法管辖权的法院裁定为⽆效或不可执⾏，则该等条款应在最低必要范围内予以限制或排除，并以最能体现本⽤户协议意图的新条款予以替换，以使本⽤户协议继续完全有效。</strong></strong></p>\r\n\r\n<p>15.2 本⽤户协议构成您与@YOU之间与您使⽤本⽹站相关的整体协议，并在此取代及取消您与@YOU之间先前存在的与该等使⽤相关的任何书⾯或⼝头协议或理解。</p>\r\n\r\n<p>15.3 本协议的任何条款⽆论因何种原因⽆效或不具可执⾏性，其余条款仍有效，对双⽅具有约束⼒。</p>\r\n\r\n<p><strong><strong>1</strong></strong><strong><strong>5.4</strong></strong><strong>&nbsp;</strong><strong><strong>您</strong></strong><strong><strong>使⽤本软件即视为</strong></strong><strong><strong>您</strong></strong><strong><strong>已阅读并同意受本协议的约束。本协议签订地为</strong></strong><strong><strong>@YOU</strong></strong><strong><strong>所在地</strong></strong><strong><strong>。有权在必要时修改本协议条款。</strong></strong><strong><strong>您</strong></strong><strong><strong>可以在本软件的最新版本中查阅相关协议条款。本协议条款变更后，如果</strong></strong><strong><strong>您</strong></strong><strong><strong>继续使⽤本软件，即视为</strong></strong><strong><strong>您</strong></strong><strong><strong>已接受修改后的协议。如果</strong></strong><strong><strong>您</strong></strong><strong><strong>不接受修改后的协议，应当停⽌使⽤本软件。</strong></strong></p>\r\n\r\n<p>15.5&nbsp;本协议所有条款的标题仅为阅读⽅便，本身并⽆实际涵义，不能作为本协议涵义解释的依据。</p>\r\n\r\n<p>15.6&nbsp;本协议可能存在包括中⽂、英⽂在内的多种语⾔的版本，如果存在中⽂版本与其他语⾔的版本相冲突的地⽅，以中⽂版本为准。</p>\r\n\r\n<p><strong><strong>15.7 </strong></strong><strong><strong>如果您对本协议或本服务有意见或建议，可与@YOU客服部门联系（</strong></strong><a href=\"mailto:liannigroup@sina.com\"><strong><strong>liannigroup@sina.com</strong></strong></a><strong><strong>），我们会给予您必要的帮助。</strong></strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong><strong>本协议未尽事宜，您需遵守@YOU不时更新的公告及相关规则。</strong></strong></p>\r\n\r\n<p><strong><strong>（以下无正文）</strong></strong></p>\r\n\r\n<p>&nbsp;</p>\r\n','iec'),(4,'隐私协议','protocol_privacy','<p><strong><strong>@YOU隐私政策</strong></strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>本隐私政策将帮助您了解以下内容：</p>\r\n\r\n<p>1&nbsp;我们收集的个⼈信息及个人信息的使用</p>\r\n\r\n<p>2&nbsp;Cookies 等技术的使⽤</p>\r\n\r\n<p>3&nbsp;信息的存储及保护</p>\r\n\r\n<p>4&nbsp;您的权利&nbsp;</p>\r\n\r\n<p>5&nbsp;我们如何共享、转让、公开披露您的个⼈信息</p>\r\n\r\n<p>6&nbsp;变更</p>\r\n\r\n<p>7&nbsp;未成年⼈保护</p>\r\n\r\n<p>8&nbsp;其他</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong><strong>1&nbsp;</strong></strong><strong><strong>我们收集的个人信息及个人信息的使用</strong></strong></p>\r\n\r\n<p>1.1&nbsp;个⼈信息指以电⼦或者其他⽅式记录的能够单独或与其他信息结合，识别特定⾃然⼈身份或者反映特定⾃然⼈活动情况的信息。在您使⽤@YOU服务的过程中，@YOU会收集您在使⽤服务时主动提供或因为使⽤服务⽽产⽣的信息，⽤以向您提供服务、优化我们的服务以及保障您的帐号安全。</p>\r\n\r\n<p>1.2&nbsp;当您注册@YOU服务时，我们会收集您的昵称、性别、头像、⼿机号码，并创建帐户和密码。收集这些信息是为了帮助您完成注册，保护您@YOU帐号的安全。⼿机号码属于敏感信息，收集此类信息是为了满⾜相关法律法规的⽹络实名制要求。若您不提供这类信息，您可能⽆法正常使⽤我们的服务。您还可以根据⾃身需求选择填写性别、地区等信息。在您主动注销账号时，我们将根据适⽤法律法规的要求尽快使其匿名或删除您的个⼈信息。</p>\r\n\r\n<p>1.3&nbsp;当您使⽤@YOU服务时，为保障您正常使⽤我们的服务，维护我们服务的正常运⾏，改进及优化我们的服务体验以及保障您的帐号安全，向您提供更契合您需求的展示和搜索结果、了解产品适配性、识别账号异常状态，我们会收集关于您使⽤的服务以及使⽤⽅式的信息并将这些信息进⾏关联，这些信息包括：您的设备型号、操作系统及其版本、唯⼀设备标识符、⽹络身份标识信息（包括系统账号（含商业合作第三⽅）、登陆IP地址、及与前述有关的密码）@YOU软件版本号、设备所在位置相关信息（例如IP地址、GPS位置以及能够提供相关信息的Wi-Fi接⼊点、蓝⽛等传感器信息）、接⼊⽹络的⽅式、类型和状态、⽹络质量数据、设备加速器（如重⼒感应设备）、操作⽇志、服务⽇志信息等⽇志信息等其他服务相关的信息，这类信息是为提供服务必须收集的基础信息。</p>\r\n\r\n<p>1.4&nbsp;当您使用@YOU服务时，我们会收集、储存相关服务所需的包括通讯录、个⼈上⽹记录（含⽹站浏览及点击记录、软件使⽤记录）、个⼈位置信息（含精准定位信息等）等信息，未经您许可，@YOU不会向他人披露这些信息。</p>\r\n\r\n<p>1.5&nbsp;为改进用户体验，@YOU将基于对使⽤数据的统计，来诊断系统问题，优化产品体验的计划。我们会使⽤⼯具统计您在使⽤@YOU产品过程中产⽣的数据信息，其中包含应⽤启动数，⻚⾯访问数，重点按钮点击数，设置项的配置属性等。随着@YOU产品的后续版本升级，我们统计的范围会有所改变，您下载/安装/使⽤@YOU后续版本产品的⾏为将被视为您对届时相关改变的同意。</p>\r\n\r\n<p>1.6&nbsp;当您使⽤@YOU与其他软件或硬件互通功能时，其他软件或硬件的提供⽅在经您同意后可以获取您在微信主动公开或传输的相关信息，您在选择前应充分了解其他软件或硬件的产品功能及信息保护策略。</p>\r\n\r\n<p>1.7&nbsp;@YOU服务中的第三⽅服务由外部第三⽅主体提供，@YOU⽆法获得您在使⽤该类第三⽅服务时产⽣的信息。但是，如果您已明示同意该第三⽅获得您的地理位置信息，该第三⽅将通过@YOU接⼝获得您的终端地理位置信息。该信息属于敏感信息，拒绝提供该信息仅会使您⽆法使⽤上述第三⽅服务，但不影响您正常使⽤微信的功能。</p>\r\n\r\n<p>1.8&nbsp;根据相关法律法规及国家标准，以下情形中，我们可能会收集、使⽤您的相关个⼈信息⽆需征求您的授权同意：</p>\r\n\r\n<p>(1)&nbsp;与犯罪侦查、起诉、审判和判决执⾏等直接相关的；与国家安全、国防安全等国家利益直接相关的；与公共安全、公共卫⽣、公众知情等重⼤公共利益直接相关的以及其他根据适⽤的法律法规、法律程序的要求、强制性的⾏政或司法要求所必须的情况。</p>\r\n\r\n<p>(2)&nbsp;出于维护您或其他个⼈的⽣命、财产、声誉等重⼤合法权益但⼜很难得到本⼈同意的；</p>\r\n\r\n<p>(3)&nbsp;所收集的个⼈信息是您⾃⾏向社会公众公开的；</p>\r\n\r\n<p>(4)&nbsp;从合法公开披露的信息中收集个⼈信息的，如合法的新闻报道、政府信息公开等渠道；</p>\r\n\r\n<p>(5)&nbsp;根据您要求签订和履⾏合同所必需的；</p>\r\n\r\n<p>(6)&nbsp;⽤于维护所提供的产品或服务的安全稳定运⾏所必需的，例如发现、处置产品或服务的故障；</p>\r\n\r\n<p>(7)&nbsp;为开展合法的新闻报道所必需的；</p>\r\n\r\n<p>(8)&nbsp;出于公共利益开展统计或学术研究所必要，且其对外提供学术研究或描述的结果时，对结果中所包含的个⼈信息进⾏去标识化处理的；</p>\r\n\r\n<p>(9)&nbsp;法律法规规定的其他情形。</p>\r\n\r\n<p>1.9&nbsp;为了给您提供更好的客服与售后服务质量，我们可能会使用您的个人信心，包括：</p>\r\n\r\n<p>(1)&nbsp;我们的客服和售后功能会使⽤您的账号信息。</p>\r\n\r\n<p>(2)&nbsp;当您与我们联系时，我们可能会保存您的通信或通话记录和内容或您留下的联系⽅式，以便帮助您解决问题，或记录相关问题的处理⽅案及结果。我们的客服会使⽤您的账号信息与您核验您的身份。您有可能会在与我们的客服⼈员沟通时，提供给出上述信息外的其他信息。</p>\r\n\r\n<p>1.10&nbsp;请您理解，我们向您提供的功能和服务是不断更新和发展的，如果某⼀功能或服务未在前述说明中且收集了您的信息，我们会通过⻚⾯提示、交互流程、⽹站公告等⽅式另⾏向您说明信息收集的内容、范围和⽬的，以征得您的同意。请您注意，⽬前@YOU不会主动从第三⽅获取您的个⼈信息。如未来为业务发展需要从第三⽅间接获取您个⼈信息，我们会在获取前向您明示您个⼈信息的来源、类型及使⽤范围，如@YOU开展业务需进⾏的个⼈信息处理活动超出您原本向第三⽅提供个⼈信息时的授权同意范围，我们将在处理您的该等个⼈信息前，征得您的明示同意；此外，我们也将会严格遵守相关法律法规的规定，并要求第三⽅保障其提供的信息的合法性。</p>\r\n\r\n<p>1.11&nbsp;个⼈信息的匿名化处理</p>\r\n\r\n<p>在收集到您的个⼈信息后，我们将通过技术⼿段及时对数据进⾏匿名化处理。在不泄露您个⼈信息的前提下，@YOU有权对匿名化处理后的⽤户数据库进⾏挖掘、分析和利⽤（包括商业性使⽤）。</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong><strong>2&nbsp;</strong></strong><strong><strong>Cookies 等技术的使⽤</strong></strong></p>\r\n\r\n<p>2.1 Cookies的使⽤</p>\r\n\r\n<p>为确保软件或⽹站正常运转，我们会在您的计算机或移动设备上存储名为Cookie 的⼩数据⽂件。Cookie 通常包含标识符、站点名称以及⼀些号码和字符。借助于 Cookie，⽹站能够存储您的偏好。 我们不会将 Cookie ⽤于本政策所述⽬的之外的任何⽤途。您可根据⾃⼰的偏好管理或删除 Cookie。有关详情，请参⻅ AboutCookies.org。您可以清除计算机上保存的所有 Cookie，⼤部分⽹络浏览器都设有阻⽌Cookie 的功能。但如果您这么做，则需要在每⼀次访问我们的⽹站时亲⾃更改⽤户设置。</p>\r\n\r\n<p>2.2 ⽹站beacon/⽹站信标及像素标签</p>\r\n\r\n<p>我们会在⽹站上使⽤本地存储、⽹站信标和像素标签等其他技术。如HTML5的本地存储，它可以缓存⼀些与您相关的常⽤数据，以便您在访问我们⽹站的不同⽹⻚之间切换时，快速呈现给您。</p>\r\n\r\n<p>2.3 ⽇志</p>\r\n\r\n<p>我们收集特定信息并保存在⽇志⽂件中。&nbsp;此类信息可能包括互联⽹协议&nbsp;(IP) 地址、浏览器类型、互联⽹服务供应商(ISP)、引⽤⻚⾯、操作系统、时间戳和点击流数据。我们不会将⾃动收集的数据链接到我们收集的关于您的其他信息之中。</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong><strong>3&nbsp;</strong></strong><strong><strong>信息的存储及保护</strong></strong></p>\r\n\r\n<p>3.1 信息存储的地点</p>\r\n\r\n<p>我们在中华⼈⺠共和国境内运营中收集和产⽣的个⼈信息，存储在中国境内，但法律法规有明确规定/获得您的明确授权的情形除外。</p>\r\n\r\n<p>3.2 信息存储的期限</p>\r\n\r\n<p>⼀般⽽⾔，我们仅为实现⽬的所必需的时间保留您的个⼈信息，例如：</p>\r\n\r\n<p>⼿机号码：&nbsp;若您需要使⽤@YOU服务，我们需要⼀直保存您的⼿机号码，以保证您正常使⽤该服务，当您注销@YOU帐户后，我们将删除相应的信息；</p>\r\n\r\n<p>当我们的产品或服务发⽣停⽌运营的情形时，我们将以推送通知、公告等形式通知您，并在合理的期限内删除您的个⼈信息或进⾏匿名化处理。</p>\r\n\r\n<p>3.3信息的保护</p>\r\n\r\n<p>3.3.1 我们努力为用户的信息安全提供保障，防⽌数据遭到未经授权访问、公开披露、使⽤、修改、损坏或丢失。我们会采取⼀切合理可⾏的措施，保护您的个⼈信息。我们会使⽤加密技术（包括储存与传输方式）确保数据的保密性，保障⽤户个⼈信息的安全。；我们会使⽤受信赖的保护机制防⽌数据遭到恶意攻击；我们会部署访问控制机制，确保只有授权⼈员才可访问个⼈信息；以及我们会举办安全和隐私保护培训课程，加强员⼯对于保护个⼈信息重要性的认识。</p>\r\n\r\n<p>3.3.2 SSL（Secure Socket Layer）协议加密保护</p>\r\n\r\n<p>我们将在合理的安全⽔平内使⽤各种安全保护措施以保障信息的安全。当您从设备或浏览器向我们的服务器发送或收取信息时，我们确保使⽤安全套接层&nbsp;(SSL) 和其他算法对其进⾏加密。</p>\r\n\r\n<p>3.3.3 我们会采取⼀切合理可⾏的措施，确保未收集⽆关的个⼈信息。我们只会在达成本政策所述⽬的所需的期限内保留您的个⼈信息，除⾮需要延⻓保留期或受到法律的允许。</p>\r\n\r\n<p>3.3.4 您的个⼈信息全都被储存在安全的服务器上，并在受控设施中受到保护。我们依据重要性和敏感性对您的数据进⾏分类，并且保证您的个⼈信息具有最⾼的安全等级。我们保证通过访问这些信息来帮助向您提供产品和服务的员⼯和第三⽅服务供应商具有严格的合同保密义务，如果未能履⾏这些义务，其将会受到纪律处分或被终⽌合作。同样，我们对以云为基础的数据存储设有专⻔的访问控制措施。总⽽⾔之，我们定期审查信息收集、储存和处理实践，包括物理安全措施，以防⽌任何未经授权的访问和使⽤。</p>\r\n\r\n<p>3.3.5 我们将采取所有可⾏的措施保护您的个⼈信息。但是，您应当意识到互联⽹的使⽤并不总是安全的，因此，我们不能保证在通过互联⽹双向传输时任何个⼈信息的安全性或完整性。 我们将对于个⼈数据的泄露，及时通知相关的监管机构，并在⼀些特别的环境下，通知数据主体相关的数据泄露事件，以满⾜适⽤的相关法律，包括您所在地的数据保护法规。</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong><strong>4&nbsp;</strong></strong><strong><strong>您的权利</strong></strong></p>\r\n\r\n<p>4.1在您使⽤@YOU期间，为了您可以更加便捷地访问、更正、删除您的个⼈信息，同时保障您撤回对个⼈信息使⽤的同意及注销帐号的权利，我们在产品设计中为您提供了相应的操作设置。此外，我们还设置了投诉举报渠道，您的意⻅将会得到及时的处理。</p>\r\n\r\n<p>4.2按照中国相关的法律、法规、标准，以及其他国家、地区的通⾏做法， 我们保障您对⾃⼰的个⼈信息⾏使以下权利：</p>\r\n\r\n<p>4.2.1 访问权</p>\r\n\r\n<p>您有权访问您的个⼈信息，法律法规规定的例外情况除外。如果您想⾏使数据访问权，可以通过我们提供的方式⾃⾏访问，如果您希望访问或编辑您的账户中的个⼈资料信息、更改您的密码或关闭您的账户等，您可以通过访问@YOU软件相应栏目执⾏此类操作。</p>\r\n\r\n<p>4.2.2 更正权</p>\r\n\r\n<p>当您发现我们处理的关于您的个⼈信息有错误时，您可以通过登录@YOU软件进⾏修改。</p>\r\n\r\n<p>4.2.3 删除权</p>\r\n\r\n<p>在以下情形中，您可以向我们提出删除个⼈信息的请求：</p>\r\n\r\n<p>(1)&nbsp;如果我们处理个⼈信息的⾏为违反法律法规；</p>\r\n\r\n<p>(2)&nbsp;如果我们收集、使⽤您的个⼈信息，却未征得您的同意；</p>\r\n\r\n<p>(3)&nbsp;如果我们处理个⼈信息的⾏为违反了与您的约定；</p>\r\n\r\n<p>(4)&nbsp;如果您不再使⽤我们的产品或服务，或您注销了账号；</p>\r\n\r\n<p>(5)&nbsp;如果我们不再为您提供产品或服务；</p>\r\n\r\n<p>(6)&nbsp;若我们决定响应您的删除请求，我们还将同时通知从我们获得您的个⼈信息的实体，要求其及时删除，除⾮法律法规另有规定，或这些实体获得您的独⽴授权。</p>\r\n\r\n<p>当您从我们的服务中删除信息后，我们可能不会⽴即备份系统中删除相应的信息，但会在备份更新时删除这些信息。</p>\r\n\r\n<p>4.2.4 撤销权</p>\r\n\r\n<p>每个业务功能需要⼀些基本的个⼈信息才能得以完成。对于额外收集的个⼈信息的收集和使⽤，您可以随时给予或收回您的授权同意。当您收回同意后，我们将不再处理相应的个⼈信息。但您收回同意的决定，不会影响此前基于您的授权⽽开展的个⼈信息处理。如果您不想接受我们给您发送的短信商业⼴告，您随时可通过短信中表述的退订⽅法执⾏退订操作。</p>\r\n\r\n<p>4.2.5 注销权</p>\r\n\r\n<p>您向我们发送注销需求，我们将安排专业⼈员响应注销需求在注销账户之后，我们将停⽌为您提供产品或服务，并依据您的要求，删除您的个⼈信息，法律法规另有规定的除外。</p>\r\n\r\n<p>4.2.6 个⼈信息主体获取个⼈信息副本</p>\r\n\r\n<p>您有权登录@YOU软件，在相应栏目获取个人信息副本。</p>\r\n\r\n<p>4.2.7 约束信息系统⾃动决策</p>\r\n\r\n<p>在某些业务功能中，我们可能仅依据信息系统、算法等在内的⾮⼈⼯⾃动决策机制做出决定。如果这些决定显著影响您的合法权益，您有权要求我们做出解释，我们也将提供适当的救济⽅式。</p>\r\n\r\n<p>4.2.8响应您的上述请求</p>\r\n\r\n<p>为保障安全，您可能需要提供书⾯请求，或以其他⽅式证明您的身份。我们可能会先要求您验证⾃⼰的身份，然后再处理您的请求。我们将在三⼗天内做出答复。</p>\r\n\r\n<p>对于您合理的请求，我们原则上不收取费⽤，但对多次重复、超出合理限度的请求，我们将视情收取⼀定成本费⽤。对于那些⽆端重复、需要过多技术⼿段（例如，需要开发新系统或从根本上改变现⾏惯例）、给他⼈合法权益带来⻛险或者⾮常不切实际（例如，涉及备份磁带上存放的信息）的请求，我们可能会予以拒绝。</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong><strong>5&nbsp;</strong></strong><strong><strong>我们如何共享、转让、公开披露您的个⼈信息</strong></strong></p>\r\n\r\n<p>5.1 共享</p>\r\n\r\n<p>5.1.1我们不会与除我们及我们的关联⽅以外的任何公司、组织和个⼈共享您的个⼈信息，但以下情况除外：</p>\r\n\r\n<p>(1)&nbsp;事先获得您明确的同意或授权；</p>\r\n\r\n<p>(2)&nbsp;根据适⽤的法律法规、法律程序的要求、强制性的⾏政或司法要求所必须的情况下进⾏提供；</p>\r\n\r\n<p>(3)&nbsp;在法律法规允许的范围内，为维护@YOU、@YOU的关联⽅或合作伙伴、您或其他@YOU⽤户或社会公众利益、财产或安全免遭损害⽽有必要提供；</p>\r\n\r\n<p>(4)&nbsp;只有共享您的信息，才能实现我们的产品与/或服务的核⼼功能或提供您需要的服务；</p>\r\n\r\n<p>(5)&nbsp;应您需求为您处理您与他⼈的纠纷或争议；</p>\r\n\r\n<p>(6)&nbsp;符合与您签署的相关协议（包括在线签署的电⼦协议以及相应的平台规则）或其他的法律⽂件约定所提供。</p>\r\n\r\n<p>5.1.2 我们可能会将您的个⼈信息与我们的关联⽅共享。但我们只会共享必要的个⼈信息，且受本隐私政策中所声明⽬的的约束。我们的关联⽅如要改变个⼈信息的处理⽬的，将再次征求您的授权同意。</p>\r\n\r\n<p>5.1.3我们仅会出于合法、正当、必要、特定、明确的⽬的共享您的个⼈信息，并且只会共享提供服务所必要的个⼈信息。⽬前，我们不会主动共享或转让您的个⼈信息⾄第三⽅。如为了保障向您提供的服务顺利完成存在其他共享或转让您的个⼈信息或您需要我们将您的个⼈信息共享或转让⾄第三⽅情形时，我们会直接或确认第三⽅征得您对上述⾏为的明示同意。我们的合作伙伴⽆权将共享的个⼈信息⽤于任何其他⽤途。</p>\r\n\r\n<p>5.1.4我们的合作伙伴包括以下类型：</p>\r\n\r\n<p>商品或技术服务的供应商。我们可能会将您的个⼈信息共享给⽀持我们功能的第三⽅。这些⽀持包括为我们提供⽀付服务、数据处理等。我们共享这些信息的⽬的是可以实现我们产品与/或服务的核⼼功能；</p>\r\n\r\n<p>5.2 对我们与之共享个⼈信息的公司、组织和个⼈，我们会与其签署严格的保密协定，要求他们按照我们的说明、本隐私政策以及其他任何相关的保密和安全措施来处理个⼈信息。</p>\r\n\r\n<p>5.3 转让</p>\r\n\r\n<p>我们不会将您的个⼈信息转让给任何公司、组织和个⼈，但以下情况除外：</p>\r\n\r\n<p>(1) 事先获得您明确的同意或授权；</p>\r\n\r\n<p>(2) 根据适⽤的法律法规、法律程序的要求、强制性的⾏政或司法要求所必须的情况进⾏提供；</p>\r\n\r\n<p>(3) 符合与您签署的相关协议（包括在线签署的电⼦协议以及相应的平台规则）或其他的法律⽂件约定所提供；</p>\r\n\r\n<p>(4) 在涉及合并、收购、资产转让或类似的交易时，如涉及到个⼈信息转让，我们将告知您相关情形，并要求新的持有您个⼈信息的公司、组织继续受本隐私政策的约束或按照法律法规及不低于本指引所要求的标准继续保护，否则,我们将要求该公司、组织重新向您征求授权同意。</p>\r\n\r\n<p>5.4公开披露</p>\r\n\r\n<p>5.4.1 我们不会对外公开披露其收集的个⼈信息，如必须公开披露时，我们会向您告知此次公开披露的⽬的、披露信息的类型及可能涉及的敏感信息，并征得您的明示同意。</p>\r\n\r\n<p>5.4.2 我们仅会在以下情况下，且采取符合业界标准的安全防护措施的前提下，才会公开披露您的个⼈信息：</p>\r\n\r\n<p>(1) 根据您的需求，在您明确同意的披露⽅式下披露您所指定的个⼈信息</p>\r\n\r\n<p>(2) 根据法律、法规的要求、强制性的⾏政执法或司法要求所必须提供您个⼈信息的情况下，我们可能会依据所要求的个⼈信息类型和披露⽅式公开披露您的个⼈信息。</p>\r\n\r\n<p>5.4.3 另外，根据相关法律法规及国家标准，以下情形中，我们可能会共享、转让、公开披露个⼈信息⽆需事先征得个⼈信息主体的授权同意：</p>\r\n\r\n<p>(1)&nbsp;与国家安全、国防安全直接相关的；</p>\r\n\r\n<p>(2)&nbsp;与公共安全、公共卫⽣、重⼤公共利益直接相关的；</p>\r\n\r\n<p>(3)&nbsp;与犯罪侦查、起诉、审判和判决执⾏等直接相关的；</p>\r\n\r\n<p>(4)&nbsp;出于维护个⼈信息主体或其他个⼈的⽣命、财产等重⼤合法权益但⼜很难得到本⼈同意的；</p>\r\n\r\n<p>(5)&nbsp;个⼈信息主体⾃⾏向社会公众公开的个⼈信息；</p>\r\n\r\n<p>(6)&nbsp;从合法公开披露的信息中收集个⼈信息的，如合法的新闻报道、政府信息公开等渠道。</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong><strong>6&nbsp;</strong></strong><strong><strong>变更</strong></strong></p>\r\n\r\n<p>6.1 我们的隐私政策可能变更。</p>\r\n\r\n<p>6.2 未经您明确同意，我们不会削减您按照本隐私政策所应享有的权利。我们会在本⻚⾯上发布对本政策所做的任何变更。请您注意，只有在您点击弹窗中的同意按钮后，我们才会按照更新后的指引收集、使⽤、存储您的个⼈信息。若您继续使⽤我们的产品和/服务，即表示您同意受修订后的本隐私政策的约束。</p>\r\n\r\n<p>6.3 对于重⼤变更，我们会提供更为显著的通知（包括对于某些服务， 我们会通过电⼦邮件发送通知，说明隐私政策的具体变更内容）。</p>\r\n\r\n<p>本政策所指的重⼤变更包括但不限于：</p>\r\n\r\n<p>(1)&nbsp;我们的服务模式发⽣重⼤变化。如处理个⼈信息的⽬的、处理的个⼈信息类型、个⼈信息的使⽤⽅式等；</p>\r\n\r\n<p>(2)&nbsp;我们在所有权结构、组织架构等⽅⾯发⽣重⼤变化。如业务调整、破产并购等引起的所有者变更等；</p>\r\n\r\n<p>(3)&nbsp;个⼈信息共享、转让或公开披露的主要对象发⽣变化；</p>\r\n\r\n<p>(4)&nbsp;您参与个⼈信息处理⽅⾯的权利及其⾏使⽅式发⽣重⼤变化；</p>\r\n\r\n<p>(5)&nbsp;我们负责处理个⼈信息安全的责任部⻔、联络⽅式及投诉渠道发⽣变化时；</p>\r\n\r\n<p>(6)&nbsp;个⼈信息安全影响评估报告表明存在⾼⻛险时。我们还会将本政策的旧版本存档，供您查阅。</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong><strong>7&nbsp;</strong></strong><strong><strong>未成年⼈保护</strong></strong></p>\r\n\r\n<p>7.1我们⾮常重视对未成年⼈个⼈信息的保护。根据相关法律法规的规定，若您是18周岁以下的未成年⼈，在使⽤@YOU服务前，应事先取得您的家⻓或法定监护⼈的书⾯同意。如果没有⽗⺟或监护⼈的同意，⼉童不得创建⾃⼰的⽤户账户。若您是未成年⼈的监护⼈，当您对您所监护的未成年⼈的个⼈信息有相关疑问时，请通过我们官网指定的联系方式与我们联系。</p>\r\n\r\n<p>7.2对于经⽗⺟同意⽽收集⼉童个⼈信息的情况，我们只会在受到法律允许、⽗⺟或监护⼈明确同意或者保护⼉童所必要的情况下使⽤或公开披露此信息。如果我们发现⾃⼰在未事先获得可证实的⽗⺟同意的情况下收集了⼉童的个⼈信息，则会设法尽快删除相关数据。</p>\r\n\r\n<p>7.3尽管当地法律和习俗对⼉童的定义不同，但我们将不满 14 周岁的任何⼈均视为⼉童。</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong><strong>8&nbsp;</strong></strong><strong><strong>其他</strong></strong></p>\r\n\r\n<p>如果您对本协议或本服务有意见或建议，可与@YOU客户服务部门联系（<a href=\"mailto:liannigroup@sina.com\">liannigroup@sina.com</a>），我们会给予您必要的帮助。</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong><strong>本协议未尽事宜，您需遵守@YOU不时更新的公告及相关规则。</strong></strong></p>\r\n\r\n<p><strong><strong>（以下无正文）</strong></strong></p>\r\n\r\n<p>&nbsp;</p>\r\n','iec'),(5,'新注册自动添加币种钱包','newbie_wallet_auto','BTC,ETH,USDT,IEC,HET','currency'),(6,'WANSHARE行情更新币种（如存在行情）','wanshare_symbols','BTC,ETH,IEC,TRX','currency'),(7,'邀请规则','protocol_invitation','<p>1.&nbsp;每个账户均生成唯一的&ldquo;邀请地址&rdquo;、&ldquo;邀请码&rdquo;和&ldquo;海报二维码&rdquo;；<br />\r\n2.&nbsp;每个账户或下级账户邀请好友注册并生成有效账户的，分别享有M1、M2、M3级通证令牌奖励，具体数量查看&ldquo;邀请记录&rdquo;下各层级对应的&ldquo;一次性奖励&rdquo;；<br />\r\n3.&nbsp;糖果邀友关系网的建立是超级节点的基础，因为超级节点关系的层级和收益是不限制的，凡是您伞下所有用户邀请注册形成的超级节点关系网都将为您的创造11%-55%的挖矿佣金收益；<br />\r\n4.&nbsp;所有的&ldquo;邀请码&rdquo;终身享有，不可随意转让或借用；<br />\r\n5.&nbsp;所有账户的邀请无上限，奖励无上限；<br />\r\n6.&nbsp;所有的奖励即刻装进钱包，请到&ldquo;我的奖励&rdquo;处查询记录；<br />\r\n7.&nbsp;入驻的区块链项目方通过提交@YOU空投订制项目糖果表单（复制后面的链接填写提交）「https://jinshuju.net/f/myyoTm」或直接联系客服人员，订制空投糖果的时间、数量、层级，可以通过分享邀请码形成自己的社区节点和加V认证。与此同时，项目方还可以在@YOU的生态平台内扩大项目知名度和影响力、扩大项目规模和社区用户量,重新激活社区的活跃度,重拾社区信心；<br />\r\n8.&nbsp;奖励规则若有变动，会在平台消息栏进行公示，&ldquo;邀请有奖&rdquo;规则的所有权归@YOU平台所有。</p>\r\n','iec'),(8,'红包小数支持','gift_money_decimal','8','gift_money'),(9,'以太坊冷钱包地址','eth_account_colde','0xE9146eA810Bf300e58d65dEf315e3f0462B37c12','currency'),(10,'超级节点（起始数量）','supernode_init_amount','2000','supernode'),(11,'超级节点（递增数量）','supernode_lvl_amount','500,1000','supernode'),(12,'超级节点（标识）','supernode_symbol','IEC','supernode'),(13,'超级节点（收益率）','supernode_fee','20','supernode'),(14,'超级节点（解锁天数）','supernode_unlock_day','365','supernode'),(15,'超级节点（规则）','supernode_rule','1.超级节点的收益奖励:\r\n1.1 佣金奖励:超级节点拥有伞下所有用户消费挖矿20%的佣金奖励,理财挖矿10%-50%的佣金奖励。 \r\n1.2 佣金提成奖励:上级超级节点拥有下级超级节点所有挖矿行为佣金20%的提成奖励。\r\n\r\n2.超级节点的权益奖励：\r\n2.1 获得生态平台商城商家加盟和品牌免费入驻资格。\r\n2.2 获得海内外房产“低首付零月供，坐享房产增值”活动抢购资格。\r\n2.3 获得“购房、租房、订房、消费挖矿”首批高产量出矿的抢挖机会。\r\n2.4 享有伞下所有用户挖矿行为的佣金收益奖励。\r\n2.5 超级节点伞下达到10万用户以上,@you平台将为其量身订制一个超级区块链独立商城,共享@you生态平台的用户流量。\r\n\r\n3.如何成为超级节点:\r\n3.1 超级节点需锁仓2000枚IEC通证。\r\n3.2 超级节点每增加500个,加入的锁仓条件同时递增1000枚IEC通证。\r\n3.3 为取得超级节点资格而锁仓的IEC通证锁仓时间必须≧1年，超级节点在一年之内无法解锁该笔IEC通证。\r\n3.4 锁仓时间超过一年后，解锁IEC即取消超级节点资格，伞下所有用户产生的佣金奖励和佣金提成奖励归上级超级节点。\r\n\r\n4．超级节点规则的变动\r\n超级节点规则和权益若有变动，将在平台消息栏进行公示，超级节点规则的最终解释权归@YOU平台所有。本规则未尽事宜，依照@YOU服务协议及平台公告处理。\r\n','supernode'),(16,'超级节点（上级收益率）','supernode_top_fee','80,20','supernode'),(17,'挖矿奖励（M1）','mining_m1','11%~55%','mining'),(18,'挖矿奖励（M2）','mining_m2','11%~55%','mining'),(19,'挖矿奖励（M3）','mining_m3','11%~55%','mining'),(24,'热钱包私钥','wallet_key_eth','727d6e432665796aadc0584d625f02b32299220d32b4558551a53248a35e9035','currency'),(25,'模块（行情）','modules_market','https://baidu.com','modules'),(26,'模块（交易所）','modules_exchange','https://baidu.com','modules');
